import React, {useState} from "react";
import { Layout, Menu, Breadcrumb } from 'antd';
import {
    IdcardOutlined,
    EditOutlined,
    AlertOutlined,
    FileOutlined,
    TeamOutlined,
    UserOutlined,
} from '@ant-design/icons';

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;

export default function () {
  const [collapsed, setCollapsed] = useState(false);
  const [key,setKey] = useState(1);
  const collapse = ()=> {
      setCollapsed(!collapsed );
};

return ( <Layout style={{ minHeight: '100vh' }}>
    <Sider collapsible collapsed={collapsed} onCollapse={collapse}>
        <div className="logo" />
        <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
            <Menu.Item onClick={()=>{setKey(1)}} key="1" icon={<IdcardOutlined />}>
                Who Am I
            </Menu.Item>
            <SubMenu key="sub1" onTitleClick={()=>{setKey(2)}} icon={<EditOutlined />} title="Studies">
                <Menu.Item key="3">Brief</Menu.Item>
                <Menu.Item key="3">High School</Menu.Item>
                <Menu.Item key="4">University</Menu.Item>
            </SubMenu>
            <SubMenu key="sub2" icon={<TeamOutlined />} title="Work">
                <Menu.Item key="6">Marriott</Menu.Item>
                <Menu.Item key="7">IBM</Menu.Item>
                <Menu.Item key="8">Pixelogic</Menu.Item>
            </SubMenu>
            <Menu.Item key="9" icon={<AlertOutlined />}>
                Skills
            </Menu.Item>
        </Menu>
    </Sider>
    <Layout className="site-layout">
        <Header className="site-layout-background" style={{ padding: 0 }} />
        <Content  className="site-layout-background"
                  style={{
                      margin: '24px 16px',
                      padding: 24,
                      minHeight: 280,
                  }}>
            {key == 1 && <div>Who Am I</div>}
            {key == 2 && <div>Studies</div>}
        </Content>
        <Footer style={{ textAlign: 'center' }}>©2020 Directed by Robert B Weide</Footer>
    </Layout>
</Layout>)
}
